import React,{Suspense} from 'react'
import { renderRoutes } from "react-router-config";

const Fallback=()=>{
  return <h1>Loading</h1>
}
const Guest = (props) => {
  const{route}=props
  console.log(props)
  return (
    <div>
      <h1>This is guest</h1>
      <Suspense fallback={<Fallback  />}>
        {renderRoutes(route.routes)}
      </Suspense>

    </div>
  )
}

export default Guest
